export default function SongCard({ song, onPlay }) {
  return (
    <div className="card">
      <img src={song.cover} alt={song.title} />
      <h3>{song.title}</h3>
      <p>{song.artist}</p>
      <button onClick={() => onPlay(song)}>▶️ Play</button>
    </div>
  );
}
